import React from 'react';
import Dropdown from 'react-bootstrap/dropdown'; 

function Header_bootstrap() {
    return (
        <Dropdown>
            <Dropdown.Toggle variant='primary' id='dropdown-basic'>
                Buy
            </Dropdown.Toggle>
            <Dropdown.Menu>
                <Dropdown.Item>
                    Home
                </Dropdown.Item>
                <Dropdown.Item>
                    Office
                </Dropdown.Item>
            </Dropdown.Menu>
        </Dropdown>
    );
}

export default Header_bootstrap;
